import { Component } from '@angular/core';

@Component({
  selector: 'app-consumer-dashboard',
  templateUrl: './consumer-dashboard.component.html',
  styleUrls: ['./consumer-dashboard.component.css']
})
export class ConsumerDashboardComponent {

}
<div class="consumer-dash">
  <h1>Consumer Dashboard</h1>
<ol>
  <a routerLink="./getAllBills"><li>Get All Bill Reports</li></a>
  <a routerLink="./getBillsByYear"><li>Get All Bill Reports By Year</li></a>
  <a routerLink="./getBillsByMonth"><li>Get All Bill Reports By Month</li></a>
  <a href=""><li>New Consumer? Register Here</li></a>
</ol>
</div>
